import React, { useState } from "react";
import { ShoppingCart, Star } from "lucide-react";

// The main component for the application
const App = () => {
  const product = {
    id: 1,
    name: "Nebula Pro Headphones",
    price: 199.99,
    description:
      "Experience crystal-clear audio with deep bass. Perfect for gaming and professional use.",
    rating: 4.8,
    // Placeholder image URL
    imageUrl: "https://placehold.co/600x400/1e293b/cbd5e1?text=Product+Image",
  };

  const [cartCount, setCartCount] = useState(0);
  const [isAdding, setIsAdding] = useState(false);

  const handleAddToCart = () => {
    setIsAdding(true);
    // Simulate an API call delay for the 'Adding...' state
    setTimeout(() => {
      setCartCount((prev) => prev + 1);
      setIsAdding(false);
    }, 500);
  };

  return (
    <div className="min-h-screen bg-gray-900 flex items-center justify-center p-4 font-sans">
      <header className="fixed top-0 left-0 w-full bg-slate-800 text-white shadow-lg z-10">
        <div className="max-w-7xl mx-auto p-4 flex justify-between items-center">
          <h1 className="text-xl font-bold text-teal-400">Ecom Starter</h1>
          <div className="relative">
            <ShoppingCart className="w-6 h-6 text-gray-300" />
            {cartCount > 0 && (
              <span className="absolute -top-2 -right-2 bg-red-500 text-xs font-bold w-5 h-5 flex items-center justify-center rounded-full ring-2 ring-gray-900 transition duration-300 ease-in-out">
                {cartCount}
              </span>
            )}
          </div>
        </div>
      </header>

      {/* Product Card Container */}
      <div className="mt-20 w-full max-w-sm sm:max-w-lg md:max-w-xl bg-slate-800 rounded-xl shadow-2xl overflow-hidden transform hover:scale-[1.01] transition duration-500 ease-in-out">
        {/* Product Image */}
        <div className="w-full h-56 sm:h-72 bg-slate-700">
          <img
            src={product.imageUrl}
            alt={product.name}
            className="w-full h-full object-cover"
            // Simple image load error handling
            onError={(e) => {
              e.target.onerror = null;
              e.target.src =
                "https://placehold.co/600x400/1e293b/cbd5e1?text=Image+Load+Error";
            }}
          />
        </div>

        {/* Product Details */}
        <div className="p-6 sm:p-8 text-gray-200">
          <h2 className="text-3xl font-extrabold text-teal-400 mb-2">
            {product.name}
          </h2>
          <div className="flex items-center mb-4">
            <div className="flex text-yellow-400 mr-3">
              {[...Array(5)].map((_, i) => (
                <Star
                  key={i}
                  className={`w-5 h-5 ${
                    i < Math.floor(product.rating) ? "fill-yellow-400" : ""
                  }`}
                />
              ))}
            </div>
            <span className="text-sm font-semibold text-gray-400">
              {product.rating} / 5.0
            </span>
          </div>

          <p className="text-gray-400 mb-6 text-base leading-relaxed">
            {product.description}
          </p>

          <div className="flex justify-between items-center">
            <span className="text-4xl font-black text-white">
              ${product.price.toFixed(2)}
            </span>

            {/* Add to Cart Button */}
            <button
              onClick={handleAddToCart}
              disabled={isAdding}
              className={`
                flex items-center space-x-2 px-6 py-3 text-lg font-semibold rounded-lg shadow-lg
                transition duration-300 transform
                ${
                  isAdding
                    ? "bg-teal-700 text-gray-300 cursor-not-allowed"
                    : "bg-teal-500 hover:bg-teal-600 text-white hover:scale-105"
                }
              `}
            >
              {isAdding ? (
                <>
                  <svg
                    className="animate-spin h-5 w-5 text-white"
                    xmlns="http://www.w3.org/2000/svg"
                    fill="none"
                    viewBox="0 0 24 24"
                  >
                    <circle
                      className="opacity-25"
                      cx="12"
                      cy="12"
                      r="10"
                      stroke="currentColor"
                      strokeWidth="4"
                    ></circle>
                    <path
                      className="opacity-75"
                      fill="currentColor"
                      d="M4 12a8 8 0 018-8V0C5.373 0 0 5.373 0 12h4zm2 5.291A7.962 7.962 0 014 12H0c0 3.042 1.135 5.824 3 7.938l3-2.647z"
                    ></path>
                  </svg>
                  <span>Adding...</span>
                </>
              ) : (
                <>
                  <ShoppingCart className="w-5 h-5" />
                  <span>Add to Cart</span>
                </>
              )}
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default App;
